import './App.css';
import {useState} from 'react';
import { FiSettings } from 'react-icons/fi';

export default function App() {
  const [sitesActive, setSitesActive] = useState(0);

  return (
    <div className="App">
      <div className="LeftNav">
        <div className="LeftNavHeader">
          <span className="LeftNavHeaderOption"
            onClick={() => setSitesActive(0)}
            style={{
              color: sitesActive == 0 ? "white" : "rgba(255,255,255,0.5)"
            }}>Sites</span>
          <span className="LeftNavHeaderOption"
            onClick={() => setSitesActive(1)}
            style={{
              color: sitesActive == 1 ? "white" : "rgba(255,255,255,0.5)"
            }}>People</span>
          <FiSettings className="SettingsIcon"/>
        </div>
      </div>
      <div className="MiddleNav"></div>
    </div>
  );
}
